import React from "react";
import "./../components/CardCours.css";
import DataSlidebar from "../DataSlidebar.json";



const CardCours = () => {
  const numbers = [1, 2, 3, 4, 5];
  const listItems = numbers.map((number) =>
        <li>{number}</li>
      );
  return (
    
    <div className="hi">
      {DataSlidebar.DeuxiemeAc.map((it) => (
        <div className="flex-container">
          <div className="card mb-4 ">
          <div className="card-body">
              <h3>{it.title}</h3>
          </div>
            <div className="card-footer d-block d-lg-flex align-items-center justify-content-between">
              <div className="card-divider">Cours</div>
              <div className="card-divider">Exercices </div>
              <div className="card-divider">Examens </div>
            </div>
          </div>
        </div>
        
      ))}
      
      

      <ul>{listItems}</ul>,
    </div>
  );
}
export default CardCours;
